import axios from 'axios';
import config from '../config/config';

function getObservationsBySeriesId(seriesId, startTime, endTime){
	startTime = startTime || '2015-08-14';
	endTime = endTime || '2019-08-13';
	const url = `${config.BASE_URL}/observations?file_type=json&api_key=${config.API_KEY}&series_id=${seriesId}&realtime_start=${startTime}&realtime_end=${endTime}`;
  	return axios.get(url).then(response => response.data);
}

export { getObservationsBySeriesId }
